// SudokuBoard.js
import React, { Component } from "react";
import SudokuCell from "./SudokuCellComponent";
import axios from "axios";

class SudokuBoard extends Component {
    state = {details: [], board: [], }

    constructor(props) {
        super(props);

        let data_game;

        axios.get('http://localhost:8000')
            .then(res => {
                data_game = res.data;

                    this.setState({
                        details: data_game,
                        board: []
                    });
                })
            .catch(err => {
                "Error mounting data"
            })


                //this.state.board = [
                //[5, 3, "", "", 7, "", "", "", ""]
                //[6, "", "", 1, 9, 5, "", "", ""],
                //["", 9, 8, "", "", "", "", 6, ""],
                //[8, "", "", "", 6, "", "", "", 3],
                //[4, "", "", 8, "", 3, "", "", 1],
                //[7, "", "", "", 2, "", "", "", 6],
                //["", 6, "", "", "", "", 2, 8, ""],
                //["", "", "", 4, 1, 9, "", "", 5],
                //["", "", "", "", 8, "", "", 7, 9],
            //]
        //};


    }

    handleCellChange = (elem, row, col, value) => {
        const newBoard = [...this.state.board];

        for (let e in this.state.details) {
            e.row1.split(",").map((cell, colIndex) => (
                newBoard[1][colIndex] = value
            ))
        }

        newBoard[row][col] = value;
        this.setState({ board: newBoard });
    };

    cellChange = (elem, row, col, value) => {

    };

    render() {
        return (
            <div className="sudoku-board">
                {this.state.details.map((elem, index) => (
                    <div key={index} className="sudoku-elem">
                        <div key={1} className={"sudoku-row"}>
                            {elem.row1.split(",").map((cell, colIndex) =>
                                <SudokuCell
                                    key={colIndex}
                                    value={cell}
                                    onChange={(value) =>
                                        this.handleCellChange(index, 1, colIndex, value)
                                    }
                                />
                            )}
                        </div>

                        <div key={2} className={"sudoku-row"}>
                            {elem.row2.split(",").map((cell, colIndex) =>
                                <SudokuCell
                                    key={colIndex}
                                    value={cell}
                                    onChange={(value) =>
                                        this.handleCellChange(index,2, colIndex, value)
                                    }
                                />
                            )}
                        </div>

                        <div key={3} className={"sudoku-row"}>
                            {elem.row3.split(",").map((cell, colIndex) =>
                                <SudokuCell
                                    key={colIndex}
                                    value={cell}
                                    onChange={(value) =>
                                        this.handleCellChange(index,3, colIndex, value)
                                    }
                                />
                            )}
                        </div>

                        <div key={4} className={"sudoku-row"}>
                            {elem.row4.split(",").map((cell, colIndex) =>
                                    <SudokuCell
                                        key={colIndex}
                                        value={cell}
                                        onChange={(value) =>
                                            this.handleCellChange(index,4, colIndex, value)
                                        }
                                    />
                                )}
                        </div>

                        <div key={5} className={"sudoku-row"}>
                            {elem.row5.split(",").map((cell, colIndex) =>
                                    <SudokuCell
                                        key={colIndex}
                                        value={cell}
                                        onChange={(value) =>
                                            this.handleCellChange(index,5, colIndex, value)
                                        }
                                    />
                                )}
                        </div>

                        <div key={6} className={"sudoku-row"}>
                            {elem.row6.split(",").map((cell, colIndex) =>
                                    <SudokuCell
                                        key={colIndex}
                                        value={cell}
                                        onChange={(value) =>
                                            this.handleCellChange(index,6, colIndex, value)
                                        }
                                    />
                                )}
                        </div>

                        <div key={7} className={"sudoku-row"}>
                                {elem.row7.split(",").map((cell, colIndex) =>
                                        <SudokuCell
                                            key={colIndex}
                                            value={cell}
                                            onChange={(value) =>
                                                this.handleCellChange(index,7, colIndex, value)
                                            }
                                        />
                                    )}
                        </div>

                        <div key={8} className={"sudoku-row"}>
                                {elem.row8.split(",").map((cell, colIndex) =>
                                        <SudokuCell
                                            key={colIndex}
                                            value={cell}
                                            onChange={(value) =>
                                                this.handleCellChange(index,8, colIndex, value)
                                            }
                                        />
                                    )}
                        </div>

                        <div key={9} className={"sudoku-row"}>
                                {elem.row9.split(",").map((cell, colIndex) =>
                                        <SudokuCell
                                            key={colIndex}
                                            value={cell}
                                            onChange={(value) =>
                                                this.handleCellChange(index,9, colIndex, value)
                                            }
                                        />
                                    )}
                        </div>
                    </div>
                ))}
            </div>
        );
    }
}

export default SudokuBoard;
